##Top n words
#takes dictionary and number n words and returns sorted dictionary of top n words
def top_n_words(in_dict, n):
    dict_list = []
    for key in sorted(in_dict.items(), key = lambda item: item[1], reverse = True)[:n]:
        dict_list += [key]
    top_n_dict = dict(dict_list)
    return top_n_dict

